import React, { useState } from 'react';
import getFinalBudget from '../Helper';
import datos from '../datos.json';

const Form = ({ setBudgetObj }) => {
  const [formData, setFormData] = useState({
    category: '',
    type: '',
    squareMeters: '',
    plan: 'basic', // Establece el plan predeterminado como básico
  });

  const [error, setError] = useState(false);

  const { category, type, squareMeters, plan } = formData;

  const fieldHandle = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const submitForm = (e) => {
    e.preventDefault();
    if (category.trim() === '' || type.trim() === '' || squareMeters.trim() === '') {
      setError(true);
      return;
    }
    setError(false);

    const selectedProperty = datos.find(
      (item) => item.categoria === category && item.tipo === type
    );
    const factor = selectedProperty ? selectedProperty.factor : 1.0;

    // Define los detalles de los planes de seguro con costos adicionales
    const insurancePlans = {
      basic: {
        name: 'Plan Básico',
        coverage: 'Cubre lo justo y necesario',
        additionalFeatures: ['Cobertura contra incendios'],
        costMultiplier: 1.2, // Factor adicional por metro cuadrado
      },
      complete: {
        name: 'Plan Completo',
        coverage: 'Incluye coberturas adicionales',
        additionalFeatures: ['Cobertura contra incendios', 'Cobertura contra robos'],
        costMultiplier: 1.5, // Factor adicional por metro cuadrado
      },
    };

    const selectedPlan = insurancePlans[plan] || insurancePlans.basic;

    const baseCost = getFinalBudget(2000, category, type) * factor * parseFloat(squareMeters) * 35.86;

    // Calcula el costo total incluyendo el factor adicional del plan
    const totalCost = baseCost * selectedPlan.costMultiplier;

    setBudgetObj({
      formData,
      budgetAmount: totalCost,
      selectedPlan,
    });

    setFormData({
      category: '',
      type: '',
      squareMeters: '',
      plan: 'basic',
    });
  };

  return (
    <form onSubmit={submitForm}>
      <div>
        <label>Categoría:</label>
        <select name="category" value={category} onChange={fieldHandle}>
          <option value="">-- Seleccione --</option>
          <option value="propiedad">Propiedad</option>
          <option value="ubicacion">Ubicación</option>
        </select>
      </div>

      <div>
        <label>Tipo:</label>
        <select name="type" value={type} onChange={fieldHandle}>
          <option value="">-- Seleccione --</option>
          <option value="Casa">Casa</option>
          <option value="P.H.">P.H.</option>
          <option value="Depto. Edificio">Depto. Edificio</option>
          <option value="Barrio Privado">Barrio Privado</option>
          <option value="Oficina">Oficina</option>
          <option value="Local Comercial">Local Comercial</option>
          <option value="Depósito Logística">Depósito Logística</option>
          <option value="CABA">CABA</option>
          <option value="Tandil">Tandil</option>
          <option value="Costa Atlántica">Costa Atlántica</option>
          <option value="Patagonia">Patagonia</option>
        </select>
      </div>

      <div>
        <label>Metros Cuadrados:</label>
        <input type="number" name="squareMeters" value={squareMeters} onChange={fieldHandle} />
      </div>

      <div>
        <label>Plan de Seguro:</label>
        <select name="plan" value={plan} onChange={fieldHandle}>
          <option value="basic">Plan Básico</option>
          <option value="complete">Plan Completo</option>
        </select>
      </div>

      <button type="submit">Cotizar</button>

      {error ? <div>Error: Completar los campos del formulario.</div> : null}
    </form>
  );
};

export default Form;
